has included the worst birthday ever, doomy warnings from a house-elf called Dobby, and rescue from the Dursleys by his friend Ron Weasley in a magical flying car! Back at Hogwarts School of Witchcraft and Wizardry for his second year, Harry hears strange whispers echo through empty corridors - and then the attacks start. Students are found as though turned to stone. Dobby\'s sinister predictions seem to be coming true. These new editions of the classic and internationally bestselling, multi-award-winning series feature instantly pick-up-able new jackets by Jonny Duddle, with huge child appeal, to bring Harry Potter to the next generation of readers. It\'s time to PASS THE MAGIC ON.',0,0),(21,'A34AAE8362','Жилет разгрузочный Тайга серый камуфляж',26,'Сезон\nНа любой сезон\nКоллекция\nВесна-лето 2020\nТип\nЖилет для рыбалки и охоты\nБренд в одежде и обуви\nТайга\nЦвет\nСерый','\nЖилет разгрузочный Тайга - функциональный жилет для охоты, рыбалки. туризма и активного отдыха.\nЖилет регулируется ремнями и подойдет людям любой комплекции.\nКолличество карманов позволяет взять с собой все необходимое.\nИзготовлен из качественных и прочных материалов.',0,0),(22,'A756799BFD','Монофильная леска для рыбалки LIDER CAMOU 020, 1 шт. по 300 м; 0.350 мм',26,'Толщина, мм\n0.350\nРазрывная нагрузка, кг\n13,705\nРазмотка, м\n300\nСтрана-изготовитель\nКитай\nБренд\nLIDER','Леска CARP plus FEEDER торговой марки LIDER разработана специально для ловли карпа и фидером. Отличается высоким качеством материала NT30, стойка к истиранию. Очень мягкая и прочная на узлах, с полным отсутствием памяти, не имеет остаточной деформации. Лески торговой марки LIDER гарантированно соответствует заявленным характеристикам, что позволило производителю завоевать признание как спортсменам, так и рыболовов-любителей по всему миру.',0,0),(23,'BC7311D247','Сумка для рыбалки Fisherman, ф06, зеленый',26,'Страна-изготовитель\nРоссия\nАртикул\nф06\nЦвет\nЗеленый\nТип\nСумка для рыбалки','Удобная универсальная сумка. Можно использовать как отдельно, так с рюкзаком, жилетом, разгрузкой и плечевой сумкой. Комплектуется спиральным шнуром с карабином, для крепления инструмента.\nИмеет держатель для спиннинга.',0,0),(24,'7BE48073F7','Пневматическая винтовка МР-512С-06',25,'Принцип действия оружия\nПружинно-поршневой\nЁмкость магазина, шт\n1\nСкорость выстрела, м/с\n105\nПриклад\nПостоянный\nКалибр оружия\n4,5 мм','Пневматическая пружинно-поршневая винтовка MP-512C исп. 06 представляет собой классический образец пневматического оружия с ручным взведением пружины при помощи поворачивающегося в вертикальной плоскости ствола («переломная» система). Винтовки оснащены пластиковыми ложами нового поколения с улучшенной эргономикой и конструкцией, рассчитанной на разные возрастные группы потребителей. Новая ложа позволяет комфортно удерживать изделие при стрельбе и взведении винтовки. Неглубокие рельефные понижения в зонах удержания изделия противостоят выскальзыванию винтовки  при переноске и стрельбе. Увеличенное окно спусковой скобы позволит использовать винтовку в перчатках при низких температурах, а резиновый затылок-амортизатор – улучшить комфортность и точность стрельбы.\nКлассическая однозарядная схема со взводом за счет поворота ствола - «переломка»',0,0),(25,'1E48DAA6C4','Масло оружейное РЖ KUDO, нейтральное, аэрозоль, 210 мл.',25,'Бренд\nKUDO\nАртикул\nKU-H420\nТип\nМасло антикоррозийное','Применяется для ухода за всеми типами металлических поверхностей любого оружия (спортивного, турнирного, охотничьего, мало- и крупнокалиберного, пневматического, газового и травматического). Эффективно очищает от нагара канал ствола, удаляет загрязнения, отлично смазывает и обеспечивает надежную работу оружейных механизмов. Рекомендуется для кратковременной защиты металлических поверхностей от коррозии, как рабочая смазка для ненагруженных узлов, работающих при температурах до –50°С.',0,0),(26,'3F313EA268','Кресло-шезлонг 53х100х70 см, Стулья.Сайт 820220',3,'Тип\nКресло-шезлонг\nШирина, см\n53\nДлина, см\n100\nВысота, см\n70\nБренд\nСтулья.Сайт','Шезлонг на деревянном каркасе неокрашенный, без отделки, из шлифованной древесины сосны, с сиденьем из ткани Армитек Рипстоп (80% полиэстер, 20% хлопок, неразрывные нити) оливкового цвета. Без подлокотников. Может использоваться в саду, на даче, на природе. Раскладывается в несколько положений: от 100х53х70 см до 97х53х91 см. При этом сиденье на высоте около 37 см. Компактно складывается для хранения и занимает 120х53х6 см.',0,0),(27,'363C01035E','Бочечный насос Gardena 4000/1, 400 Вт',3,'Тип\nБочечный насос\nДвигатель для садовой техники\nЭлектродвигатель, Электродвигатель\nМакс. напор, м\n13, 13\nМощность, Вт\n400, 400\nМеханизм насоса\nЦентробежный','http://nowatermark.ozone.ru/s3/multimedia-6/6059163234.jpg',0,0),(28,'70A502F89B','Чехол на стульчик для кормления',4,'Тип\nАксессуар к стульчикам для кормления\nМатериал чехла\nТекстиль\nБренд\ndolly-kids\nСтрана-изготовитель\nРоссия\nАртикул\n3303s','\nЧехол универсальный на стульчик для кормления от Dolly-kids полностью заменяет старый или служит накидкой на имеющийся.Чехол выполнен из хлопка, поэтому ребенок в нем не потеет, натуральная ткань идеально подходит при использовании стульчика в качестве люльки. Чехол легко стирается и быстро сохнет.Создает дополнительную мягкость.Устраняет дискомфорт от прохладной поверхности сиденья. Имеются отверстия для ремней безопасности.Подходит для большинства стульчиков для кормления,прогулочных колясок,качелей.',0,0),(29,'6647572B48','Набор Barbie Семья кукла+щенки с аксессуарами FXH08',5,'Тип\nИгровой набор с куклой\nВозраст ребенка\nОт 3 лет\nСтрана-изготовитель\nКитай\nАртикул\nFXH08\n','Кукла Барби и четыре очаровательные собачки с забавными игровыми функциями станут отличным подарком для вашей малышки. Барби готова целый день играть со своими питомцами.',0,0),(30,'9607302899','Морковь мытая, 1 кг',29,'Цена за 1000 гр\n79 ₽\nТип\nМорковь\nВес товара, г\n1000\nФорма выпуска овощей, фруктов, зелени\nЦелые\nЭнергетическая ценность, ккал/100 г\n41','Это отборные корнеплоды, очищенные от грязи, имеющие примерно одинаковый размер и форму. Богата витаминами А, С, D, группы В, магнием, калием, кальцием и фосфором.',0,0),(31,'5E789B6626','Велком Докторская колбаса, 500 г',28,'Колбаса\nВид мяса\nСвинина\nВид колбасы\nДокторская\nОболочка\nИскусственная\nСпособ обработки\nВареные','Нежная консистенция и особенный вкус этой традиционной вареной колбасы, произведенной по рецептуре ГОСТ, отвечает всем стандартам качества мясной гастрономии. Формат куска фиксированного веса идеален для тостов, бутербродов и нарезки.',0,0),(32,'2B95524060','Кофе молотый Lavazza Crema e Gusto, 250 г в/у',7,'Тип\nКофе молотый\nСостав кофе\nАрабика/Робуста\nСтепень обжарки\nТемная\nСтепень помола\nСредний\nИнтенсивность вкуса\nКрепкий','Lavazza Crema Gusto - это великолепный купаж индийской робусты и бразильской арабики. Зерна были подвержены сильной обжарке, за счет которой получается крепкий и насыщенный вкус, а также густая пенка.\nСмесь подойдет для приготовления в домашних условиях в кофемашине, гейзерной кофеварке и в турке.',0,0);
